import React, { useState, useEffect } from 'react';
import Game from './components/Game';
import Name from './components/Name';
import './App.css';
import axios from 'axios';
import { response } from 'express';


function App() {
  return (
    <div className="App">
      <h1>ゲーム集</h1>
      <Game />
      <br /><br />
      <h2>High Scores</h2>
        <ul>
          {scores.map((score) => (
            <li key={score.id}>
              {score.ranking}位 {score.name} : {score.score}
            </li>
          ))}
        </ul>
    </div>
  );
}

export default App;
